import React from 'react'

const InfoLanding = () => {
    return(
        <div className='relative inset-x-center-section h-screen-76% w-2/3 bg-athens-gray grid grid-areas-landing-layout-info'>
            <div className='grid grid-in-top-section bg-black'>

            </div>
            <div className='grid grid-in-middle-section bg-school-bus-yellow'>

            </div>
            <div className='grid grid-in-bottom-section bg-prussian-blue'></div>
        </div>
    )
}

export default InfoLanding;
